import React, { Component } from "react";

export default class Pay extends Component {
	render() {
		const {cartItem} = this.props;
		return (
			<div>
				{cartItem.length === 0 ? (
					<div>
						<h1>cart is empty</h1>
					</div>
				) : (
					<div>
						<h1>cart have: {cartItem.length} item</h1>
					</div>
				)}
                <div>
                    {cartItem.map((item)=>(
                        <div>
                            <h3>{item}</h3>
                        </div>
                    ))}
                </div>
			</div>
		);
	}
}
